MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "Novice users will need to learn the different aspects and use models for Calibre LITHOview and Calibre WORKbench, a combined tool for model development and simulation.");
MGCAddSnippet(5, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(6, "The CalibreLITHOview and CalibreWORKbench tools are designed for the resolution enhancement technology (RET) user. They add simulation and modeling capabilities to the CalibreDESIGNrev layout viewing and editing tool. ");
MGCAddSnippet(7, "An important concept to understand is that there are two entry points into Calibre WORKbench. ");
MGCAddSnippet(8, "Calibre WORKbench creates multiple kinds of models.");
MGCAddSnippet(9, "Calibre WORKbench and Calibre LITHOview have different prerequisites.");
MGCAddSnippet(10, "To run any of the Calibre layout viewers, you must have the license file required by the tool. Calibre DESIGNrev, WORKbench, LITHOview, and MDPview each require a different license. ");
MGCAddSnippet(11, "Calibre WORKbench is typically invoked from a LinuxLinux is a registered trademark of Linus Torvalds in the U.S. and other countries. command shell. Run Calibre WORKbench using command-line arguments, a run script containing commands, or from the Calibre WORKbench GUI for interactive simulation and model creation tasks.");
MGCAddSnippet(12, "Run Calibre WORKbench on one or more remote hosts by adding Calibre MTflex standard command line arguments to your invocation string.");
MGCAddSnippet(13, "Invoke a Calibre tool GUI by using just the executable name on the command line (as shown in the following table). In Calibre LITHOview, some tools may not be available.");
MGCAddSnippet(14, "Load a design file using one of the following configurations:");
MGCAddSnippet(15, "In order to speed up the initial load of the design, specify the -hideLayers option on the command line. ");
MGCAddSnippet(16, "Use the -incr option as another method to speed up initial design load times.");
MGCAddSnippet(17, "Use the -HC option for faster loading of large layouts.");
MGCAddSnippet(18, "Use the -endDepth startup command to set the initial display depth of the specified loaded layout.");
MGCAddSnippet(19, "Use the ‑rft argument to load an existing flow and open the RET Flow Tool window. ");
MGCAddSnippet(20, "Run a Calibre WORKbench batch script (a text file that contains commands as if you had typed them in the Calibre WORKbench shell window) using the following command at the command prompt.");
MGCAddSnippet(21, "Specifying  calibre -drc  instead of  calibrewb  skips using the Calibre WORKbench GUI, runs Calibre nmDRC in batch mode, and sends output from the SVRF rulefile directly to the file drc.log.");
MGCAddSnippet(22, "Some Calibre WORKbench tool functionality is only available when you provide a specific command-line option to Calibre WORKbench. ");
MGCAddSnippet(23, "Calibre WORKbench can open an OASIS file in read-only mode.");
MGCAddSnippet(24, "Other options perform specific functions that affect the behavior of Calibre WORKbench on startup.");
MGCAddSnippet(25, "Use the table to learn the flows and information for simulation tools in Calibre WORKbench.");
MGCAddSnippet(26, "Use the table to learn the flows and information for using test pattern tools in Calibre WORKbench.");
MGCAddSnippet(27, "Use the table to learn the flows and information for using optical models in Calibre WORKbench.");
MGCAddSnippet(28, "Use the table to learn the flows and information for using VT5 resist model tools in Calibre WORKbench.");
MGCAddSnippet(29, "Use the table to learn a brief overview for using CM1 and VEB modeling tools in Calibre WORKbench.");
MGCAddSnippet(30, "Each step in IC processing contributes to systematic distortion in the production of a circuit on silicon. ");
MGCAddSnippet(31, "Running OPC for double exposure lithography requires a model that employs two optical models, one for each mask exposure, plus a resist model and possibly an etch model. Modeling double exposure configurations is supported by CM1 Center and modelflow_v2. ");
MGCAddSnippet(32, "Calibre WORKbench is usable as an image simulator for designs. Several tools are available in the Calibre WORKbench GUI and through batch commands to calculate and display the effects of a process model set.");
MGCAddSnippet(33, "One of the primary uses for the Calibre WORKbench and LITHOview applications is creating and refining setup files. These setup files are required when using Calibre LITHOview and Calibre WORKbench simulation tools as well as Calibre WORKbench modeling tools. ");
MGCAddSnippet(34, "Access points for the Calibre LITHOview and Calibre WORKbench simulation tools consist of the items shown in the following table.");
MGCAddSnippet(35, "The simulation tools available in Calibre LITHOview and Calibre WORKbench are in the RET Flow Tool.");
MGCAddSnippet(36, "The Calibre LITHOview and Calibre WORKbench simulation tools have some common characteristics that apply to their use. ");
MGCAddSnippet(37, "Use Calibre WORKbench to perform simulations of various types, such as print image contours, aerial image maps and contours, fragmentation, and OPC.");
MGCAddSnippet(38, "Calibre LITHOview and Calibre WORKbench provide default values for simulation that can be used to create an initial setup file. There are several session types for various tools, but simulation tasks require only a Simulation setup.");
MGCAddSnippet(39, "Best practices for simulation tools apply during aerial image simulation testing.");
MGCAddSnippet(40, "Calibre WORKbench provides a display tool that can be used to create a process window (PW) plot. The Process Window plot shows the common process window, best focus, and best dose across a set of gauges. It displays two types of plots in separate tabs – a Common Process Window (CPW) and exposure latitude (EL) versus depth of focus (DOF) plot. It provides controls to toggle individual gauges or adjust model settings to quickly see how they affect the CPW or EL vs DOF values.");
MGCAddSnippet(41, "Simulation commands can be entered at the command shell prompt, and are directly related to running simulations in Calibre WORKbench and Calibre LITHOview.");
MGCAddSnippet(42, "Simulation commands are entered from the Calibre WORKbench console window.");
MGCAddSnippet(43, "This command simulates the aerial image intensity within an area defined by the specified bounding box. It calculates the intensity at evenly spaced points defined by an image grid, defined by pixsz.  This command passes its results to the specified grid object. The grid object must exist prior to issuing this command. To inspect the data in text format, you can use the dump method for the grid object to save the data as a text file.");
MGCAddSnippet(44, "This command simulates the aerial image intensity along a cutline. It calculates the intensity at the two endpoints and at evenly spaced intervals along the cutline. The output is a Tcl result string that is a list of {x y value} triplets, representing (x,y) coordinates where the intensity was simulated, and the value of the aerial image at (x,y).");
MGCAddSnippet(45, "This command simulates the aerial image intensity along chosen points on the cutline. It computes the cutlines for several z-planes within the resist. This can be plotted as I(x,z) to allow you to view standing waves in the resist. ");
MGCAddSnippet(46, "Performs a dense printimage simulation using a VT5 model.");
MGCAddSnippet(47, "This command tests the interaction radius ripple on a given setup file. It returns an ordered list of integers representing the widths of lines on the OPC output layer. The first value represents the first line. ");
MGCAddSnippet(48, "This command converts empirical (measurement) data from a pitch array into a lookup_file format. The lookup_file format is required for utp::verify.");
MGCAddSnippet(49, "This command generates comparison data, comparing CDs resulting from PRINTimage simulations to CDs predicted by interpolating from the measurement data in a pitch lookup table. (It is assumed that OPC is performed based on the pitch structures, so the spreadsheet points to the pitch locations only.) To generate this data, it runs cdsample simulations for a corrected layout.");
MGCAddSnippet(50, "Builds a persistent index for a VSB chip. Calibre WORKbench uses the index in its rendering algorithm to increase the drawing speed at high depth settings. ");
MGCAddSnippet(51, "The Process Window plot shows the common process window, best focus, and best dose across a set of gauges. It displays two types of plots in separate tabs - a Common Process Window (CPW) and exposure latitude (EL) versus depth of focus (DOF) plot. It provides controls to toggle individual gauges or adjust model settings to quickly see how they affect the CPW or EL vs DOF values.");
MGCAddSnippet(52, "Test patterns are valuable for creating models. Other than the generic test patterns available through the Test Pattern Tool, Calibre WORKbench also provides a means to create custom test patterns.");
MGCAddSnippet(53, "Test pattern design tools are available in Calibre WORKbench.");
MGCAddSnippet(54, "Creating layouts of test patterns can be performed using the Calibre Pattern Generator (CPG). Using the CPG tools, test patterns for the modeling flow can be created and iteratively updated for the new requirements of advanced nodes.");
MGCAddSnippet(55, "Test pattern generation is the first step in the litho modeling flow where a test layout is created with pre-determined geometries required by the RET modeling process. The Calibre Pattern Generator (CPG) is a flexible tool for creating basic and complex patterns for test layouts.");
MGCAddSnippet(56, "Use the Calibre Pattern Generator to create a test pattern to add to a layout.");
MGCAddSnippet(57, "Use the Calibre Pattern Generator to create a layout with test patterns.");
MGCAddSnippet(58, "Use the Calibre Pattern Generator to copy a pattern from Calibre WORKbench and save it to a pattern library.");
MGCAddSnippet(59, "Creating test patterns can be performed using a number of different methods involving the Calibre WORKbench GUI and batch commands parser.");
MGCAddSnippet(60, "Test patterns are predetermined groups of geometries that do not have a circuit function, but when broken up and recombined with other test pattern geometries can be made to resemble functional design elements. ");
MGCAddSnippet(61, "Test patterns have one or more spreadsheets associated with them to capture the data. The Siemens EDA test pattern generator facilities usually create a single spreadsheet to accompany a test pattern design file, which you use when entering the measurements taken on the chip post-process.");
MGCAddSnippet(62, "Test pattern creation and usage is the first step in generating a process model. You use this as the initial design on a test wafer. ");
MGCAddSnippet(63, "Choosing a test pattern and modeling flow is an exercise in understanding the kind of design requirements you need to model.");
MGCAddSnippet(64, "Test patterns created by Calibre WORKbench are the fastest method to generate a test chip. Currently, versions V10, V11, and V12 of test patterns are available through the GUI interface. ");
MGCAddSnippet(65, "The process you use when you send a mask design to the mask shop dictates how you create the test pattern and use it with the VT5 Center tool. Two flows are presented here, differing in terms of the relationship between the target CD, design CD, and mask CD. ");
MGCAddSnippet(66, "Siemens EDA test patterns follow a specific organization and schema.");
MGCAddSnippet(67, "Use the Calibre WORKbench Test Pattern tool to create a starting test pattern at your node level. ");
MGCAddSnippet(68, "As an alternative to using the Test Pattern tool in Calibre WORKbench, you can create and use your own test pattern generation file. Calibre WORKbench supports the use of batch commands that take formatted files as input. ");
MGCAddSnippet(69, "The sandwich test pattern templates allow you to create highly customized test patterns.");
MGCAddSnippet(70, "Once you have generated a test pattern and the accompanying sample spreadsheet file, you measure the critical dimensions of the structures and record the values. ");
MGCAddSnippet(71, "The VT5 Center tool is a multi-tab, multifunction utility for creating models. The Sample, in tab is used to manage and modify sample spreadsheet file contents. ");
MGCAddSnippet(72, "You create a super spreadsheet from multiple spreadsheets (a maximum of 128 spreadsheets can be combined into a single super spreadsheet) in Calibre WORKbench. The super spreadsheet you create is used as input to the VT5 Center tool. ");
MGCAddSnippet(73, "Following test pattern best practices generally improves test pattern quality.");
MGCAddSnippet(74, "Certain simple practices are meant for users who create test patterns with the Calibre WORKbench Test Pattern tool.");
MGCAddSnippet(75, "If you are going to create a custom test pattern, your pattern should follow certain requirements.");
MGCAddSnippet(76, "Calibre IPSE is an image parameter space exploration tool that enhances test pattern creation by examining the coverage of a test pattern versus an actual design. ");
MGCAddSnippet(77, "The Test Pattern tools use specific GUIs, commands, and file formats. When you use the Calibre Pattern Generation tool or Calibre WORKbench GUI, the interface creates calls to the underlying commands and file formats. ");
MGCAddSnippet(78, "To help you access functionality, this section lists the major tools, icons, fields, and menus of the Calibre Pattern Generator.");
MGCAddSnippet(79, "The Pattern Creator (PC) tool creates the pattern templates and libraries used to generate test pattern layouts for RET modeling. The Pattern Creator can create templates for single features and arrays of features.");
MGCAddSnippet(80, "The Layout Generator (LG) tool creates and edits the layout files used to generate test pattern layouts for RET modeling. The Layout Generator places the patterns, labels, and markers for test pattern design.");
MGCAddSnippet(81, "The Scripting Area tool shows the Tcl script to edit and use for layout generation.");
MGCAddSnippet(82, "Calibre Pattern Generator (CPG) file format descriptions are described in the sections that follow:");
MGCAddSnippet(83, "A text format for generating test patterns using the Calibre Pattern Generator (CPG) tool.");
MGCAddSnippet(84, "A text format for generating test pattern layouts using the Calibre Pattern Generator (CPG) tool.");
MGCAddSnippet(85, "The following commands are used in the Calibre Pattern Generator Script Area or API. ");
MGCAddSnippet(86, "Places an autofocus marker in a layout configuration file.");
MGCAddSnippet(87, "Adds a pattern library path to the configuration file.");
MGCAddSnippet(88, "Places a SEM marker in a layout configuration file.");
MGCAddSnippet(89, "Sets the array dimensions, cell size, and spacing for the layout. ");
MGCAddSnippet(90, "Finds and configures a marker in a marker library. ");
MGCAddSnippet(91, "Configures a pattern template index.");
MGCAddSnippet(92, "Specifies the layout configuration file to create.");
MGCAddSnippet(93, "Places a configured pattern in a specified row and column.");
MGCAddSnippet(94, "Places a fine alignment marker in a layout configuration file.");
MGCAddSnippet(95, "Sets the gauge layer number.");
MGCAddSnippet(96, "Sets the marker library to read markers from.");
MGCAddSnippet(97, "Sets the SEM alignment marker layer number.");
MGCAddSnippet(98, "Sets the name of the output gauge file.");
