MGCAddSnippet(130, "Optical models are white box models; they rely on both accurate input and tuning to fit the empirical data. This chapter describes how to generate and tune an optical model.");
MGCAddSnippet(131, "The following table shows the tools used to create optical models and a description of where to find more information.");
MGCAddSnippet(132, "Optical model generation is the result of selecting and configuring multiple options that define the characteristics of the optical model. Your choices must be appropriate in order to match the characteristics of your optical system (wavelength, NA, source, film stack, and so on). ");
MGCAddSnippet(133, "Information about the scanner optical system and wafer processing conditions are needed before an optical model can be generated. ");
MGCAddSnippet(134, "While the general flow of optical model creation is the same, Calibre WORKbench makes two methods of optical model creation available:");
MGCAddSnippet(135, "In the first phase of the optical model creation process, you set the physical parameters of the optical system. These parameters are required for any optical model.");
MGCAddSnippet(136, "An illumination source that matches the optical lithography exposure conditions must be defined before the optical model is created. ");
MGCAddSnippet(137, "Optical models in the Calibre WORKbench application use the Sum Of Coherent Systems (SOCS) model, which is an approximation of the full Hopkins simulation and provides a fast intensity calculation. This section describes the optical model components that define the SOCS kernel parameters and affect the accuracy of the approximation.");
MGCAddSnippet(138, "The SOCS approximation to the full Hopkins imaging equations uses a reduced number of kernels to represent the imaging equations compared to the full Hopkins kernel set. Choosing the number of kernels that best represents the optical model must start with an arbitrary initial choice that is evaluated and revised after an initial optical model is built. ");
MGCAddSnippet(139, "The optical diameter defines the size of the square of spatial influence of the optical system. Interactions between proximate edges are possible when the edges are separated by a distance up to the optical diameter.");
MGCAddSnippet(140, "In this step, you add film stack information to the optical model. Accurate film stack information, such as thickness, refraction, and absorption of all layers, improves the model accuracy. ");
MGCAddSnippet(141, "During wafer patterning a pellicle film covers the mask. The pellicle film has an effect on the optical image. The pellicle function is needed at hyper NA. Thus, for numerical apertures above 1, it is recommended that pellicle information be included in the optical model. ");
MGCAddSnippet(142, "Advanced users can customize the optical model to account for mask patterning, resist diffusion, or other factors that impact the aerial image.");
MGCAddSnippet(143, "Focusblur modeling in Calibre WORKbench can be optionally modeled for use with CM1 models in the Optical Model Tool or by editing the focusblur keyword parameters in the optical model file. ");
MGCAddSnippet(144, "The following additional methods can be used to create source maps.");
MGCAddSnippet(145, "A source map can be created by combining several illumination primitives and applying an error function (ERF) to smooth the edges of the source if needed. ");
MGCAddSnippet(146, "When a source map is measured on an exposure scanner, it usually contains a small degree of asymmetry and some measurement noise. Since OPC models should generally have x-axis reflection, y-axis reflection, and often also 90-degree rotation symmetry, the measured source map has to be adjusted to achieve symmetric OPC. ");
MGCAddSnippet(147, "As an alternative to using the Source View tool to explicitly symmetrize a source map, you can specify it during optical model generation using a setting in the optical model definition file. ");
MGCAddSnippet(148, "The fitmap command generates a parametrized source map by fitting source parameters to a known source map. ");
MGCAddSnippet(149, "Advanced users can further customize the optical model using the following optional functions:");
MGCAddSnippet(150, "Every time an optical model is created, the system generates a source map file called illummap.smf and stores it in the optical model directory. ");
MGCAddSnippet(151, "The Source Viewer (OpticsSource View) supports multiple types of optical model files:");
MGCAddSnippet(152, "The Difference utility (FileOpen Maps Difference) allows you to see the differences between two source maps in order to assess the quality of a fitmap result versus an input illumination file. It can be used on two unpolarized source map files or two polarized source map files. If source map files with different pixel step sizes are compared, the source with the smaller pixel step size is interpolated to the larger pixel step size before determining the difference.");
MGCAddSnippet(153, "For polarized sources, four graphs are displayed:");
MGCAddSnippet(154, "For Jones pupil sources, eight graphs are displayed in the Jones Pupil View representing the real and imaginary components:");
MGCAddSnippet(155, "You can use the FileExport menu items to write the source file to the disk. ");
MGCAddSnippet(156, "Extreme ultraviolet (EUV) models follow conventional OPC modeling techniques in that they use an optical and a resist model. This chapter covers the additional steps required for the EUV variety of optical and resist models. ");
MGCAddSnippet(157, "An EUV system uses a much lower wavelength (in the 13.5 nm range, which is about a 10x reduction in wavelength) compared to a standard system. At this wavelength, optics must be all reflective. ");
MGCAddSnippet(158, "Creating an EUV model is similar to creating a DUV model, but adds steps to the flow.");
MGCAddSnippet(159, "A flare model file is required for creating the PNG flare map. ");
MGCAddSnippet(160, "The flare map is a PNG file which, when used with an EUV litho model, specifies the flare as a function of position in the layout. EUV flare effects have a very long range, and are approximated by a convolution with the mask instead of the intensity to speed up computation.");
MGCAddSnippet(161, "An initial EUV optical model is most effectively created by using the Optical Model Tool in Calibre WORKbench.");
MGCAddSnippet(162, "An optical model file cannot fully model the offsets required for mask edge movement. Calibre WORKbench uses a separate domain decomposition model (DDM) file to simulate 3D mask reflection. DDM models precompute rigorous edge responses to incident plane waves. ");
MGCAddSnippet(163, "The DDM Edge Library Creation tool, available in Calibre WORKbench, can be used as a method to create DDM models for use with EUV optical models.");
MGCAddSnippet(164, "Litho models simplify access to a collection of process models. The Calibre nmModelflow tool requires litho models for simulation and calibration runs.");
MGCAddSnippet(165, "Stages represent simulation and calibration commands in a job. When you use the Flow Stage Wizard, you define simulation commands and set parameters and optimizer settings for an optimization run. Calibration jobs can be run independently, or can be linked with the results of another calibration job. ");
MGCAddSnippet(166, "Calibration jobs are the core of optimization for Calibre nmModelflow. For EUV calibration, you create multiple concurrent jobs using stages that must be run in order.");
MGCAddSnippet(167, "Calibration jobs are explicitly executed. This allows you to set up multiple experiments before running any job(s). ");
MGCAddSnippet(168, "Use the RET Flow Tool in Calibre WORKbench to view cutline information for EUV. ");
MGCAddSnippet(169, "Use the Load Flare Map tool in Calibre WORKbench to view flare map information for EUV.");
MGCAddSnippet(170, "Use the RET Flow Tool in Calibre WORKbench to view flare map information for EUV.");
MGCAddSnippet(171, "Global litho models are used to model through-slit effects in EUV configurations.");
MGCAddSnippet(172, "An EUV through-slit litho model (referred to as a global litho model) is a set of multiple litho models in subdirectories collected under a parent litho model. Each litho model subdirectory contains a variation of a DDM and an optical model, specified at different x-coordinates in the EUV field.");
MGCAddSnippet(173, "Calibre nmModelflow can be used to create global litho models from existing optical models and DDM libraries.");
MGCAddSnippet(174, "A global litho model is used during EUV through-slit modeling. It is an extended form of a litho model that contains multiple DDM and optical models (referred to as sub-litho models) at multiple x-coordinates in the EUV field. Each litho model represents a slit location.");
MGCAddSnippet(175, "Stochastic models are supported using batch commands and Calibre OPCverify functionality in Calibre nmModelflow. ");
MGCAddSnippet(176, "The Stochastic Compact Model (STCM) is a resist model calibration enhancement model that can be used to account for shot noise in EUV optical sources. (While stochastic models can be used with DUV optical sources, current data results indicate that the stochastic effects for DUV are negligible.)");
MGCAddSnippet(177, "Stochastic models require a modified version of a gauge file to input the stochastic high and low data for calibration.");
MGCAddSnippet(178, "Stochastic models are not intended to replace existing resist models. Instead, they allow for calibration using an uncertainty factor defined in the stochastic model. Use this task to simulate the behavior of the stochastic model.");
MGCAddSnippet(179, "A correctly calibrated stochastic model increases the predictive accuracy of the model when used with a CM1 and EUV optical model.");
MGCAddSnippet(180, "Stochastic modeling adds functionality to Calibre OPCverify");
MGCAddSnippet(181, "Optical model formats and commands are used to create optical models. The various optical GUI tools in Calibre WORKbench construct optical model command arguments and use optical model formats as input and output.");
MGCAddSnippet(182, "Optical model file formats are used as inputs and outputs to optical model commands.");
