MGCAddSnippet(292, "To pre-load the model generation data, you load the optical model, spreadsheet data, and the setup file into Calibre WORKbench. ");
MGCAddSnippet(293, "Cleaning up measurement data involves adjusting the sample spreadsheet so that invalid measurement points are not included in the calculations. Weighting important measurement points causes them to be valued more than others. ");
