MGCAddSnippet(549, "Calibre Tools implement rigorous mask simulation modeling using the Calibre MaskSim tool. Calibre MaskSim is an electromagnetic field (EMF) solver that uses a Finite Difference Time Domain (FDTD) method to compute simulated waves in a custom constructed mask. ");
MGCAddSnippet(550, "The use of a domain decomposition method (DDM) library is optional for optical model calibration. DDM models are primarily used with HHA. ");
