MGCAddSnippet(556, "Because you have modified your optical model for HHA approximations, you must recompile and recalibrate the optical model. This procedure describes modifying a model layer file to load the DDM model file before optimizing the optical model.");
MGCAddSnippet(557, "Optical model calibration using modelflow_v2 also supports DDM groups, which allows fine calibration of a DDM model stackslope parameter. Because a single DDM model might not be effective for all layers (main features versus SRAF and fill layers might have different DDM characteristics) you can create DDM groups from multiple DDM models. Calibre WORKbench can then be used to optimize the DDM groups in stage1 of modelflow_v2. ");
MGCAddSnippet(558, "A combined set of optical and DDM libraries can be loaded into Calibre nmOPC and Calibre OPCverify. ");
MGCAddSnippet(559, "3D Mask Modeling uses a number of separate file reference formats to define its input and output libraries.");
MGCAddSnippet(560, "Defines the mask characteristics of a single 1D edge in a simplified, compact way, without exposing you to more complicated details of the generalized masksim solver. ");
MGCAddSnippet(561, "Domain decomposition method (DDM) model output files primarily contain the near electromagnetic field edge diffraction information that is needed in order to apply the modeling effects of light scattering for three-dimensional mask topography. Each DDM model is associated with one or more layers in the setup file. ");
MGCAddSnippet(562, "The corner model modifies DDM modeling by changing the way that mask transmission signals are computed. ");
MGCAddSnippet(563, "The cross talk model modifies DDM modeling by changing the way that mask transmission signals are computed. ");
MGCAddSnippet(564, "Collects multiple dense DDM models into a single group. This group can be calibrated inside modelflow_v2. Each group should include two or more DDM models, since the DDM group function extrapolates between the DDM models in a group. ");
MGCAddSnippet(565, "Calibre WORKbench uses certain filename conventions to share data between components. It also uses some environment variables to set or modify some of its behavior.");
MGCAddSnippet(566, "Calibre WORKbench has certain standard file types and customary extensions.");
MGCAddSnippet(567, "The following environment variables are used by Calibre WORKbench.");
MGCAddSnippet(568, "Calibre WORKbench users should follow certain best practices when creating process models The best practice advisory notes help you produce the best quality models or assist in the reduction of calibration times.");
MGCAddSnippet(569, "There are many best practices for optical modeling.");
MGCAddSnippet(570, "Global recommendations for optical models apply whether the model is intended for use with VT5 or CM1 resist models.");
MGCAddSnippet(571, "The best practices recommended for CM1 and VEB models from the main documentation are collected here. ");
MGCAddSnippet(572, "Configure the modelflow command scripts with these suggested starter settings:");
MGCAddSnippet(573, "Consider the following best practices when optimizing a CM1 model:");
MGCAddSnippet(574, "When you are performing VEB modeling, Siemens EDA recommends the best practices presented here for maintaining VEB model quality and calibration runtime for various aspects of your design flow.");
MGCAddSnippet(575, "The Lithomodel Creation Wizard is intended to ease the creation of litho models for Calibre tools that use them. Litho models are composed of existing optical, resist, and other related models that are in a central directory location. ");
MGCAddSnippet(576, "Litho models are a collection of models. You can specify one litho model instead of loading each type of models individually. Litho models are a key component of Calibre WORKbench. Calibre tools that use litho models can load all necessary models with a single command. ");
MGCAddSnippet(577, "The Lithomodel Creation Wizard collects all inputs that are required to create a litho model file.");
MGCAddSnippet(578, "During litho model creation, you have the option to create a custom VEB etch model instead of using the VEB modelform templates.");
MGCAddSnippet(579, "Litho model commands are Tcl batch commands that are run by the Lithomodel Creation Wizard, but can also be used in batch programming. ");
MGCAddSnippet(580, "Creates a litho model directory using the specified source models. ");
MGCAddSnippet(581, " SRAF printing  models can be produced using the Calibre WORKbench tool. SRAF printing models predict which SRAFs start printing during chip fabrication. These models are used during simulation to produce better OPC recipes.");
MGCAddSnippet(582, "The following items are required to perform the SRAF calibration flow.");
MGCAddSnippet(583, "The following definitions may help you to understand how to perform the tasks in this appendix.");
MGCAddSnippet(584, "SRAF gauge files can optionally be created using a set of SEM images that correspond to the gauges in the test pattern file.");
MGCAddSnippet(585, "Use modelflow_v2 Stage 1 to create and calibrate a CTR model for use with SRAF test gauges.");
MGCAddSnippet(586, "3D resist modeling is usually recommended at 22nm technology nodes or below. At this node size, the vertical height of resist structures is relevant to the final design. It is typically needed when there a low k1 imaging situation. A 3D resist model may need vertical diffusion and z-dependent terms in CM1 to be more accurate. A model without these terms can still predict a resist profile, but the accuracy of that profile may not be good enough. The presence of strong standing waves generally indicates a resist model benefits from 3D. ");
MGCAddSnippet(587, "3D Resist modeling is performed in Calibre WORKbench using CM1 Center. ");
MGCAddSnippet(588, "Follow this task to calibrate the optical model in modelflow_v2. You perform two calibrations; the first only calibrating beamfocus and defocus start, and the second using beamfocus, def_start, and vertical diffusion to see if it provides a more accurate model.");
MGCAddSnippet(589, "Follow this task to calibrate a CM1 resist model for use with the 3D resist optical model. ");
MGCAddSnippet(590, "Follow these tasks to use the 3D resist optical and CM1 model with the Calibre nmOPC and Calibre OPCverify tools. ");
MGCAddSnippet(591, "Manual extraction of useful data from CD SEM images can be a time-consuming process open to human error. The SEMSuite toolset provides the following tools to reduce the task time and human error involved with processing CD SEM images:");
MGCAddSnippet(592, "Use the Raw Data Filtering tool to create a gauge file from CD SEM files.");
MGCAddSnippet(593, "Use the Contour Data Flow tool to extract contours from CD SEM images.");
MGCAddSnippet(594, "");
MGCAddSnippet(595, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

